import React, { Component } from 'react';

export class FindConvexHull extends Component {
    static displayName = FindConvexHull.name;

    constructor(props) {
        super(props);
        this.state = { currentCount: 0 };
        this.incrementCounter = this.incrementCounter.bind(this);
    }

    render() {
        return (
            <div>
                <p>Hello world</p>
            </div>
        );
    }
}
